input length = 21;
input tolerance = 0.04;

plot defaultPlot = 
(ABSValue( BollingerBands(length" = length)."LowerBand" - BollingerBands("length" = length)."LowerBand" from 1 bars ago) / BollingerBands("length" = length)."LowerBand" from 1 bars ago) <= tolerance

